The '''TzHaar-Hur-Rin's Ore and Gem Store''' is a [[Gem stall]] and [[Shop Counter (ore)]] located within the inner city of [[Mor Ul Rek]]. It is located east of [[TzHaar-Hur-Zal's Equipment Store]] in the south-east section of the city. The store is run by [[TzHaar-Hur-Rin]]. The store sells [[gems]] and [[ores]] for varying amounts of [[Tokkul]]. Notably, this shop is one of the few ways of obtaining an [[uncut onyx]], others being killing [[Zulrah]] and [[Skotizo]].

If [[Karamja gloves 1]] or better are equipped while trading with this shop, the prices of all items are reduced. For example, while it normally costs 300,000 Tokkul for an uncut onyx, wearing the gloves reduces this to 260,000. Additionally, this also causes the shop to pay more Tokkul for items sold to it.

This store has separate stock for [[ironmen]].

