==Trivia==
*Players would need to sell 28,889 [[chaos rune]]s or 14,445 [[death runes]] to [[TzHaar-Mej-Roh's Rune Store]] while having the [[Karamja gloves 1]] or better equipped to earn enough TokKul to purchase the [[uncut onyx]].
*Alternatively, players could sell 233 [[Runite Ore]] while having the [[Karamja gloves 1]] or better equipped to earn enough TokKul to purchase the [[uncut onyx]].

